import React from "react";
import Main from "./components/main";

const MainBlock = styled.div`
  width: 100vw; // %로 하면 오류가 뜨는데 이유 찾아보기.
  height: 100vh;
  background: #e6e6e6;
`;

function App() {
  return (
    <>
      <Main />
    </>
  );
}

export default App;
